import { Link, useParams } from "react-router-dom";
import Footer from "../../footer/Footer";
import Header from "../../header/Header";
import FounderCard from "../../layout/card/FounderCard";
import "../homePage/HomePage.scss";
import { Fragment } from "react";
import { useSelector } from "react-redux";
import { useAppDispatch } from "../../../store/store";
import { useEffect } from "react";
import { fetchFounders } from "../../../store/founderDataSlice";

const FounderPage = () => {
  const dispatch = useAppDispatch();
  const { founders } = useSelector((state: any) => state.founders);

  useEffect(() => {
    dispatch(fetchFounders());
  },[]);

  const params: any = useParams();
  const founderDetails = founders.filter(
    (founder: any) => founder.founderName === params.founderName
  );
  return (
    <Fragment>
      <Header />
      x <Link to={`/founder/${founderDetails.founderName}`} className="founder-img">
                <img
                  src={founderDetails.founderImage}
                  alt="founder"
                  className="founder-img"
                ></img>
                <h1>{founderDetails.founderName}</h1>
              </Link>
      <h1>{params.founderName}</h1>
      <div>
        {founderDetails[0].founderName}
      </div>
      <div>
        {founderDetails[0].founderAge}
      </div>
      <div>
        {founderDetails[0].founderLinkedin}
      </div>
      <Footer />
    </Fragment>
  );
};

export default FounderPage;
